select --top 10
    t.x.value('@serialnumber','varchar(100)') as serialnumber,
    REPLACE(t.x.value('@jdeassetnumber','varchar(20)'),',','') as jdeassetnumber,
	CONVERT(datetime,(SELECT top 1 value FROM STRING_SPLIT(t.x.value('@lastmodifiedate','varchar(10)'), ' ')), 101) as [last maintenance date]
	into dbo.Wireline_LastScheduleMaintenancePerformed
from @xml.nodes('/DATAPACKET/ROWDATA/ROW') t(x)

use AesOps;

--query to add schedule
select monitor.*, w.* 
from aesimport.dbo.Wireline_LastScheduleMaintenancePerformed w
join fixedassets f on w.jdeassetnumber = f.AssetNumber
join CBMMonitorAssetItemNums childpart on f.InventoryItemNum = childpart.ItemNum and childpart.IsParent = 0
join CBMMonitorAssetItemNums parentpart on parentpart.CBMMonitorId = childpart.CBMMonitorId 
	and f.InventoryItemNum = parentpart.ItemNum and parentpart.IsParent = 1
join CBMMonitor monitor on childpart.CBMMonitorId = monitor.CBMMonitorId 
		and MeterReadingTypeId = 5